import { Form, Button, Container, Card } from 'react-bootstrap';
//import SecondPage from './SecondPage';

function FirstPage(){
    return (<div>
        <Container fluid>
            <Card style = {{color: '#000'}}>
            <Card.Img src = 'https://picsum.photos/id/237/1000/500'/>
            <Card.Body>
                <Card.Title>
                Welcome To the Page :
                </Card.Title>
                <Button>SignUp</Button>
            </Card.Body>
            </Card>
        </Container>
    </div>);
}

export default FirstPage;
